create table daily_summaries
(
    id                                         int unsigned auto_increment
        primary key,
    store_id                                   int unsigned                              not null comment '所属店铺（变更记录本身关联店铺或用户的分销店铺）',
    increased_income_in_cents                  bigint unsigned default 0                 not null comment '新增业绩',
    paid_with_balance_amount_in_cents          bigint unsigned default 0                 not null comment '余额支付金额',
    new_registered_user_number                 bigint unsigned default 0                 not null comment '新增会员数',
    increased_withdrawal_balance_in_cents      bigint unsigned default 0                 not null comment '新增用户可提现余额',
    applied_withdrawal_in_cents                bigint unsigned default 0                 not null comment '已申请的提现金额',
    approved_withdrawal_in_cents               bigint unsigned default 0                 not null comment '已通过申请的提现金额',
    rejected_withdrawal_in_cents               bigint unsigned default 0                 not null comment '已驳回申请的提现金额',
    task_award_in_cents                        bigint unsigned default 0                 not null comment '任务奖励佣金',
    raffle_times                               bigint unsigned default 0                 not null comment '组团开奖次数',
    raffle_user_number                         bigint unsigned default 0                 not null comment '组团开奖参与人数',
    raffle_win_user_number                     bigint unsigned default 0                 not null comment '中奖人数',
    raffle_lost_user_number                    bigint unsigned default 0                 not null comment '未中奖人数',
    raffle_win_award_point                     bigint unsigned default 0                 not null comment '中奖赠送积分（计入积分池的分数）',
    raffle_point_pool_dispatched_point         bigint unsigned default 0                 not null comment '积分池已赠送积分',
    used_raffle_ticket_number                  bigint unsigned default 0                 not null comment '已使用抽奖券张数',
    remaining_raffle_ticket_number             bigint unsigned default 0                 not null comment '剩余抽奖券张数',
    normal_product_award_point                 bigint unsigned default 0                 not null comment '平价赠送积分（计入积分池的分数）',
    normal_product_point_pool_dispatched_point bigint unsigned default 0                 not null comment '平价已赠送积分',
    summary_date                               datetime                                  not null comment '统计区间（按天统计，值为当天的0时0分0秒）',
    created_at                                 datetime        default CURRENT_TIMESTAMP not null,
    updated_at                                 datetime                                  null
)
    collate = utf8mb4_unicode_ci;

create index daily_summaries_store_id_index
    on daily_summaries (store_id);

create index daily_summaries_summary_date_index
    on daily_summaries (summary_date);

